import{_ as a,o as i,c as r,z as e,a as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 63.2-207 Authority to receive grants-in-aid, funds and gifts.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-207.md","filePath":"vacode/63.2-207.md"}'),n={name:"vacode/63.2-207.md"},o=e("h1",{id:"§-63-2-207-authority-to-receive-grants-in-aid-funds-and-gifts",tabindex:"-1"},[t("§ 63.2-207 Authority to receive grants-in-aid, funds and gifts. "),e("a",{class:"header-anchor",href:"#§-63-2-207-authority-to-receive-grants-in-aid-funds-and-gifts","aria-label":'Permalink to "§ 63.2-207 Authority to receive grants-in-aid, funds and gifts."'},"​")],-1),s=e("p",null,"The Commissioner is authorized to receive, for and on behalf of the Commonwealth and its subdivisions, from the United States and agencies thereof, and from any and all other sources, grants-in-aid, funds and gifts, made for the purpose of providing, or to assist in providing, for funds for child welfare services including day care for children, disaster relief and emergency assistance awards, Temporary Assistance for Needy Families, and general relief, or any of them, including expenses of administration. Subject to the written approval of the Governor, the Commissioner is also authorized to receive from all such sources grants-in-aid, funds and gifts made for the purpose of alleviating, treating or preventing poverty, delinquency or other social problems encountered in programs under the supervision or administration of the Commissioner. All such funds shall be paid into the state treasury.",-1),d=e("p",null,[t("Code 1950, § 63-44; 1962, c. 297; 1964, c. 88; 1966, c. 105; 1968, c. 578, § 63.1-36; 1977, c. 37; 2002, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747",target:"_blank",rel:"noreferrer"},"747"),t(".")],-1),c=[o,s,d];function f(l,h,u,g,m,p){return i(),r("div",null,c)}const y=a(n,[["render",f]]);export{_ as __pageData,y as default};
